import React from 'react';

const Show = props => (

    <div className="weather__info">

      { props.type && <p>Job Type: 
        <span>{ props.type }</span>
        </p>
      }

      { props.url && <p>URL: 
        <span>{ props.url }</span>
        </p> 
      }
      { props.created_at && <p>Created At: 
        <span>{ props.created_at }</span>
        </p> 
      }
      { props.company && <p>Cmpany Name: 
        <span>{ props.company }</span>
        </p> 
      }
      { props.company_url && <p>Company URL: 
        <span>{ props.company_url }</span>
        </p> 
      }
      { props.location && <p>Job Location: 
        <span>{ props.location }</span>
        </p> 
      }
      { props.job_title && <p>Job Title: 
        <span>{ props.job_title }</span>
        </p> 
      }
      { props.description && <p>Job Description: 
        <span>{ props.description }</span>
        </p> 
      }
      { props.company_logo && <p>Company Logo: 
        <span>{ props.company_logo }</span>
        </p> 
      }
      { props.how_to_apply && <p>How to apply: 
        <span>{ props.how_to_apply }</span>
        </p> 
        }
      { props.error && <p>

        </p> 
        }

    </div>
);


export default Show;
